h1></div> <div class="col-span-12 mb-14 lg:mb-10"><img src="../../_image/i/rs%EF%B9%95fit%EF%B9%951320%EF%B9%95700/format%EF%B9%95jpg/preset%EF%B9%95placeholder/3269f83722d2239f0e1eefe5fc5d5e73.jpg" data-src="../../_image/i/rs%EF%B9%95fit%EF%B9%951320%EF%B9%95700/format%EF%B9%95jpg/3269f83722d2239f0e1eefe5fc5d5e73.jpg" class="object-cover -lazyload -lazyload-preloader"></div></div> <div class="grid grid-cols-12"><div class="col-span-8 lg:col-span-12  typography typography-old text-lg lg:text-base"><p>Рынок&nbsp;&mdash; постоянно эволюционирующая система. На&nbsp;заре предпринимательства достаточно было производить какой-либо товар. В&nbsp;Средние века чтобы оставаться востребованным, требовалось производить больше и&nbsp;дешевле. Сто лет назад на&nbsp;первое место вышло качество продукта. Сегодня, когда уровень конкуренции в&nbsp;большинстве отраслей чрезвычайно высок, невозможно покорить Олимп только за&nbsp;счет качества и&nbsp;цены. Чтобы быть востребованным, нужна &laquo;фишка&raquo;. Особенность, которая поможет выделиться и&nbsp;запомниться. Такой &laquo;фишкой&raquo; может стать личный бренд. Что это такое, чем он&nbsp;отличается от&nbsp;бренда компании или продукта, кому остро необходим, а&nbsp;кому может помещать? Ответы на&nbsp;эти и&nbsp;другие вопросы в&nbsp;сегодняшней статье. Поехали!</p>
<h3>Персональный бренд. Немного теории</h3>
<div align="right">
<p>Личный бренд &mdash; это то, что о вас говорят люди, когда вы выходите из комнаты</p>
<p>Джефф Безос, основатель Amazon</p>
</div>
<p>Бренд &mdash; это не стиль в одежде, не число подписчиков в соцсетях и даже не известное имя. Вернее, это тоже важно. Но первичны все-таки ассоциации и &laquo;мыслечувства&raquo;, которые возникают у людей при упоминании имени или при взгляде на фотографию. Стив Джобс, Анатолий Вассерман, Илон Маск &mdash; это не просто известные имена. Это люди-образы, люди-бренды с определенной репутацией.</p>
<p>Несмотря на тысячелетия эволюции, человек биологически остается общественным животным с врожденными стайными инстинктами. Мы все хотим ассоциировать себя с кем-то и зачастую думаем: &laquo;Мне нравится этот парень. Мне близки его убеждения, и я хочу быть похожим на него!&raquo;. Мы покупаем у людей, имеющих схожие взгляды, интересы, вкусы. Именно поэтому в условиях высокой рыночной конкуренции так важно иметь персональный бренд. Это те самые &laquo;+100 очков к карме&raquo;, которые позволят привлечь и удержать потребителя.</p>
<p><img src="data:image/png;base64,"></p>
<h3>Три кита персонального брендинга, или Какие элементы составляют структуру бренда?</h3>
<p>В основе каждого личного бренда лежит фундамент, сложенный их трех &laquo;кирпичиков&raquo;. Это экспертность, репутация и популярность. Чтобы было понятнее, давайте рассмотрим их чуть подробнее.</p>
<ul>
<li><strong>Экспертность или профессионализм</strong></li>
</ul>
<p>В вашем направлении высокая конкуренция? Чтобы продавать больше и дороже, станьте экспертом. Персональный бренд невозможно построить на пустом месте. Он требует опоры в виде умений, идей, вдохновения. Знать все и обо всем невозможно. Да это и не нужно. Достаточно одной темы. Но вы должны изучить ее глубже, чем другие. Стать экспертом, к мнению которого будут прислушиваться окружающие.</p>
<p>Самое известное произведение Казимира Малевича &laquo;Черный квадрат&raquo; оценивается в&nbsp;20&nbsp;миллионов долларов. И&nbsp;если быть откровенным, то&nbsp;вовсе не&nbsp;из-за своей потрясающей красоты. Просто картину написал Казимир Малевич&nbsp;&mdash; основоположник супрематизма. Человек-бренд, чья профессиональная подготовка не&nbsp;вызывает сомнений.</p>
<p>Среднестатистический ученик художественной школы способен повторить &laquo;Черный квадрат&raquo;. Но&nbsp;сможет&nbsp;ли он&nbsp;его продать хотя&nbsp;бы за&nbsp;20&nbsp;долларов? Ответ очевиден.</p>
<ul>
<li><strong>Репутация</strong></li>
</ul>
<p>Это определенное мнение, которое закрепилось о человеке. Невозможно в одночасье заставить людей забыть о промахах, вызывающих поступках, недостойном поведении. Помните известный интернет-мем с изображением носка и подписью &laquo;Меня трудно найти и легко потерять&raquo;? Репутация во многом похожа. На создание положительного мнения уходят месяцы и годы упорного труда. А вот теряется она в считанные секунды.</p>
<p>Можно привести немало примеров того, как человек-бренд подорвал собственную репутацию одной неосторожной фразой. Джон Аллан, который является президентом крупнейшей британской сети супермаркетов Tesco, однажды посетовал на&nbsp;то, что сейчас удачное время для женщин и&nbsp;представителей национальных меньшинств, а&nbsp;белые мужчины превращаются в&nbsp;вымирающий вид. Сразу после этих слов на&nbsp;него обрушился шквал критики, который заставил оправдываться и&nbsp;Аллана, и&nbsp;корпорацию Tesco. И&nbsp;нужно отметить, что извинения помогли только частично. Как говорится, ложечки нашлись, но&nbsp;осадочек остался.</p>
<p>Планируя разработку, создание и&nbsp;продвижение личного бренда, ни&nbsp;на&nbsp;секунду не&nbsp;забывайте о&nbsp;репутации. Она должна быть безупречной.</p>
<ul>
<li><strong>Известность</strong></li>
</ul>
<p>Репутация &mdash; это первооснова бренда личности. Но она не принесет пользы без известности. Если о вас знают всего несколько человек, то вряд ли они смогут существенно увеличить или уменьшить продажи. Итак, репутация &mdash; это то, что о вас говорят. Известность &mdash; как часто говорят.</p>
<p>Впрочем, это не&nbsp;значит, что о&nbsp;вас должны знать абсолютно все. Достаточно широкой известности в&nbsp;узком кругу. Ваша задача&nbsp;&mdash; охватить целевую аудиторию и&nbsp;запомниться ей&nbsp;с&nbsp;положительной стороны. Тогда, чтобы порекомендовать вас кому-либо, человеку не&nbsp;нужно будет знать вас лично.</p>
<p><img src="data:image/png;base64,"></p>
<h3>Кому нужен личный бренд, а&nbsp;кому он&nbsp;только мешает?</h3>
<p>Прежде чем перейти к вопросам создания и продвижения персонального бренда, давайте разберемся, в каких видах деятельности от станет ключом к успеху, а в каких &mdash; якорем, тормозящим плавание.</p>
<p>Итак, для кого развитие собственного бренда является необходимостью? Прежде всего, для индивидуальных мастеров. Причем вне зависимости от направления и масштаба деятельности. Это может быть:</p>
<ul>
<li>кондитер, работающий в районном поселке с населением 10 тысяч человек;</li>
<li>модный парикмахер, салон которого находится в&nbsp;центре Москвы;</li>
<li>автослесарь, недавно открывший СТО на&nbsp;окраине города.</li>
</ul>
<p>А&nbsp;еще в&nbsp;эту категорию стоит включить адвокатов, стоматологов, юристов, фотографов, художников, артистов и&nbsp;других &laquo;одиночек&raquo;.</p>
<p><br>Если вы&nbsp;планируете создать или развивать свой бизнес, то&nbsp;собственный бренд тоже не&nbsp;будет лишним. Он&nbsp;поможет привлечь аудиторию и&nbsp;дистанцироваться от&nbsp;других компаний, работающих в&nbsp;вашей нише. При правильном подходе персональный бренд не&nbsp;конкурирует с&nbsp;корпоративным или товарным, а&nbsp;поддерживает его. Вспомните Стива Джобса! Только благодаря ему бренд Apple стал таким сильным.</p>
<p>Примеров, когда личный бренд помогает в развитии компании, можно привести еще очень и очень много. Илон Маск и SpaceX, Олег Тиньков и &laquo;Тинькофф Банк&raquo;, Марк Цукерберг и Facebook, Джефф Безос и Amazon &mdash; те случаи, когда личный и корпоративный бренд образовали удачный симбиоз и помогают друг другу. Но так бывает не всегда. Персональный бренд может тормозить развитие компании.</p>
<p>Давайте коротко подведем итог и определим, в каких случаях разработка собственного бренда не имеет смысла, а кому стоит вложить время и деньги в собственное &laquo;я&raquo;.</p>
<p><strong>Личный бренд не нужен, если человек:</strong></p>
<ul>
<li>не является профессионалом ни в одной из сфер и не планирует им стать в ближайшее время;</li>
<li>считает, что можно за пару месяцев не только придумать, но и реализовать стратегию развития личного бренда;</li>
<li>не осознает, для чего ему свой бренд и хочет создать его только потому, что &laquo;так все делают&raquo;;</li>
<li>придерживается принципов, которые противоречат позиционированию корпоративного бренда;</li>
<li>вспыльчив, любит поспорить и не всегда корректен в общении с оппонентами.</li>
</ul>
<p><strong>Личный бренд нужен, если человек:</strong></p>
<ul>
<li>эксперт в какой-то области, готов доказывать это и делиться знаниями с окружающими;</li>
<li>понимает, что персональный бренд &mdash; это навсегда, с ним придется работать всю жизнь;</li>
<li>четко видит задачи и цели, в решении и достижении которых может помочь личный бренд;</li>
<li>искренне разделяет ценности компании и ведет себя сообразно корпоративной философии;</li>
<li>умеет отстаивать свою точку зрения, но делает это вежливо, аргументировано и с уважением к собеседнику.</li>
</ul>
<p><img src="data:image/png;base64,"></p>
<h3>Топ-3 мифов о&nbsp;личном бренде</h3>
<p>С помощью социальных сетей можно за пару недель сделать свой бренд известным</p>
<p>К сожалению, это не так. Социальные сети &mdash; это инструмент. В умелых руках более чем эффективный. Но даже при наличии всех необходимых инструментов автослесарь не переберет двигатель за полчаса, а ювелир не создаст украшение за вечер. То же относится и к личному бренду. Можно выйти голым на площадь и стать известным. Но это про хайп, а не про брендинг. Если вы намерены развивать свой бренд, запаситесь терпением.</p>
<p><strong>Личный бренд &mdash; это образ, а не человек</strong></p>
<p>В какой-то мере это действительно так. Все мы хотим казаться чуть лучше, чем есть на самом деле. Но невозможно носить маску в режиме 24/7. Если концепция личного бренда не совпадает с мироощущением человека, его чувствами и убеждениями, то рано или поздно противоречие проявит себя. Представьте модельера, который долгое время позиционировал себя защитником животных, и вдруг выпустил коллекцию из натурального меха. Некрасиво, не правда ли?</p>
<p>Если вы&nbsp;не&nbsp;знаете, как начать свой бренд, перебираете варианты, придумываете различные образы, то&nbsp;у&nbsp;нас для вас плохая новость. Рано или поздно маска будет сорвана.</p>
<p>Просто помните, что персональный бренд&nbsp;&mdash; это&nbsp;вы. Со&nbsp;всеми плюсами и&nbsp;минусами, которые у&nbsp;вас есть. Обратите внимание! Это не&nbsp;значит, что не&nbsp;нужно развиваться и&nbsp;работать со&nbsp;своими недостатками. Мы&nbsp;говорим о&nbsp;том, что не&nbsp;нужно притворяться тем, кем вы&nbsp;не&nbsp;являетесь. Правда всегда вылезет наружу.</p>
<p><strong>Персональный бренд отнимает все свободное время</strong></p>
<p>Создание и продвижение персонального бренда действительно требует времени. Но совсем не так много, как принято считать. Если вы ничего не выдумываете и позиционируете собственную личность как бренд, то вам не придется тратить силы на поддержку идеального образа. Ваша задача состоит в том, чтобы показать окружающим, чем и как вы занимаетесь.</p>
<p>Каждая рабочая встреча, каждый ответ подписчику, каждый комментарий или пост&nbsp;&mdash; это вклад в&nbsp;развитие. Вы&nbsp;все равно встретились&nbsp;бы с&nbsp;клиентом, ответили подписчику и&nbsp;написали пост на&nbsp;своей странице. Так почему&nbsp;бы не&nbsp;извлечь из&nbsp;повседневных действий дополнительную выгоду?</p>
<p>Если вы&nbsp;хорошо представляете себе позиционирование и&nbsp;у&nbsp;вас есть стратегия продвижения, то&nbsp;непосредственная работа (как мы&nbsp;обычно ее&nbsp;себе представляем) с&nbsp;личным брендом будет занимать около одного часа в&nbsp;день. Пожалуй, это не&nbsp;настолько высокая плата за&nbsp;возможность добиться успеха в&nbsp;том, что вы&nbsp;делаете.</p>
<p><img src="data:image/png;base64,"></p>
<h3>Как создать личный бренд?</h3>
<p>Очень хотелось дописать в подзаголовке &laquo;с нуля&raquo;. Но с нуля не получится. Дело в том, что персональный бренд у вас уже есть. То, что думают о вас окружающие &mdash; это и есть бренд. Поэтому придется работать с тем, что есть. И возможно, исправлять ситуацию.</p>
<blockquote>&mdash; Эх, машина что-то барахлит. Поеду после работы в автосервис. Опять придется ползарплаты там оставить...<br>&mdash; Зачем тебе в сервис? Помнишь Серегу, моего соседа по гаражу? Золотые руки у мужика! Сделает все в лучшем виде и денег немного возьмет.</blockquote>
<p>Это пример личного бренда и того, как он работает. Если вы являетесь экспертом в какой-то области и имеете положительную репутацию, то у вас есть хорошая фора. Используйте ее с умом и все получится!</p>
<p>А теперь расскажем о формировании концепции персонального брендинга. Итак, пять шагов, которые нужно пройти:</p>
<p><strong>1. Самоидентификация.</strong></p>
<p>Кто вы? Какими желаниями живете, какой вы специалист, каковы ваши убеждения, как себя позиционируете? Подумайте об этом и честно ответьте на все вопросы. Помните, что ключевое слово здесь &mdash; честно. Оцените себя таким, каким вы являетесь, а не хотите казаться.</p>
<p><strong>2. Экспертность.</strong></p>
<p>Невозможно одинаково хорошо разбираться в&nbsp;психологии дошколят, строительстве межгалактических крейсеров и&nbsp;приготовлении варенья из&nbsp;огурцов. Чтобы стать признанным экспертом и&nbsp;сформировать личный бренд, развивайте одно направление. Но&nbsp;на&nbsp;порядок глубже, чем другие люди.</p>
<p><strong>3. Философия.</strong></p>
<p>Этот пункт про ценности, отношение к жизни и окружающим. Не только в бизнесе, но и в общении с друзьями, семьей, знакомыми и незнакомыми людьми. Важно: не начинайте брендинг, пока не определитесь с философией, поскольку именно она является фундаментом, на котором строится бренд.</p>
<p><strong>4. Оригинальность.</strong></p>
<p>Чем выше уровень конкуренции, тем важнее отличаться. Что можно использовать для уникализации собственного бренда? Буквально все! География, узкая ниша, дополнительные ценности, узнаваемый стиль, отличная от&nbsp;других форма предоставления услуг&nbsp;&mdash; ваше УТП может быть построено на&nbsp;любой особенности. Главное, чтобы оно было интересно не&nbsp;только вам, но&nbsp;и&nbsp;целевой аудитории.</p>
<p><strong>5. Легенда.</strong></p>
<p>Расскажите о себе. Как вы пришли в это направление. С чем вам пришлось столкнуться? Какие трудности вы преодолели, чтобы достигнуть того, что имеете? Люди любят истории. И либо вы расскажите свою историю сами, либо аудитория придумает ее за вас.</p>
<p>Ну&nbsp;вот, собственно, и&nbsp;все! Осталось собрать информацию воедино и&nbsp;модель личного бренда готова. Конечно, впереди будет еще очень и&nbsp;очень много работы&nbsp;&mdash; от&nbsp;выбора стратегии продвижения до&nbsp;управления репутацией. Но&nbsp;это уже совсем другая история.</p>
<p>Да, кстати! Личный бренд не обязательно создавать лично. В этом плане он ничем не отличается от корпоративного или товарного, поэтому его можно заказать в брендинговом агентстве. Например, вы можете воспользоваться услугами онлайн-сервиса Brand hub. Свяжитесь с нами через форму на сайте или позвоните: +7 (495) 118-33-14.</p>
