ton_view_rounded"><div class="base-button__effect"></div> <div class="base-button__content transition-fast"><!----> <div class="base-button__content-wrapper"><div class="base-button__side transition-fast"><svg width="28" height="28" xmlns="http://www.w3.org/2000/svg" class="icon sprite-icons svg-icon svg-icon_telegram"><use href="/_nuxt/2d0d2da8d9b310fc62ebc0eb312599b6.svg#i-telegram" xlink:href="/_nuxt/2d0d2da8d9b310fc62ebc0eb312599b6.svg#i-telegram"></use></svg></div> <!----> <!----></div></div></button></div> <div class="absolute bottom-0 left-0 z-30"><button type="button" class="shadow-inner-white base-button base-button_theme_green base-button_view_rounded"><div class="base-button__effect"></div> <div class="base-button__content transition-fast"><!----> <div class="base-button__content-wrapper"><div class="base-button__side transition-fast"><svg width="28" height="28" xmlns="http://www.w3.org/2000/svg" class="icon sprite-icons svg-icon svg-icon_whatsapp"><use href="/_nuxt/2d0d2da8d9b310fc62ebc0eb312599b6.svg#i-whatsapp" xlink:href="/_nuxt/2d0d2da8d9b310fc62ebc0eb312599b6.svg#i-whatsapp"></use></svg></div> <!----> <!----></div></div></button></div></div></div></div></div></div></div><script>window.__NUXT__=(function(a,b,c,d,e,f,g){return {layout:"default",data:[{post:{title:"Человек как бренд. Персональный брендинг в действии",slug:"chelovek-kak-brend-personalnyy-brending-v-deystvii",shortDescription:"Рынок&nbsp;&mdash; постоянно эволюционирующая система. На&nbsp;заре предпринимательства достаточно было производить какой-либо товар. В&nbsp;Средние века чтобы оставаться востребованным, требовалось производить больше и&nbsp;дешевле. Сто лет назад на&nbsp;первое место вышло качество продукта. Сегодня, когда уровень конкуренции в&nbsp;большинстве отраслей чрезвычайно высок, невозможно покорить Олимп только за&nbsp;счет качества и&nbsp;цены. Чтобы быть востребованным, нужна &laquo;фишка&raquo;. ",createdAt:"2021-11-11T10:37:16+03:00",isImported:d,image:{file:{url:"\u002Fuploads\u002Ffile\u002F3\u002F2\u002F6\u002F3269f83722d2239f0e1eefe5fc5d5e73.png",name:"3269f83722d2239f0e1eefe5fc5d5e73.png",originalName:"avatar.png",extension:"png",size:"362 Кб"}},content:{id:433,text:"\u003Cp\u003EРынок&nbsp;&mdash; постоянно эволюционирующая система. На&nbsp;заре предпринимательства достаточно было производить какой-либо товар. В&nbsp;Средние века чтобы оставаться востребованным, требовалось производить больше и&nbsp;дешевле. Сто лет назад на&nbsp;первое место вышло качество продукта. Сегодня, когда уровень конкуренции в&nbsp;большинстве отраслей чрезвычайно высок, невозможно покорить Олимп только за&nbsp;счет качества и&nbsp;цены. Чтобы быть востребованным, нужна &laquo;фишка&raquo;. Особенность, которая поможет выделиться и&nbsp;запомниться. Такой &laquo;фишкой&raquo; может стать личный бренд. Что это такое, чем он&nbsp;отличается от&nbsp;бренда компании или продукта, кому остро необходим, а&nbsp;кому может помещать? Ответы на&nbsp;эти и&nbsp;другие вопросы в&nbsp;сегодняшней статье. Поехали!\u003C\u002Fp\u003E\r\n\u003Ch3\u003EПерсональный бренд. Немного теории\u003C\u002Fh3\u003E\r\n\u003Cdiv align=\"right\"\u003E\r\n\u003Cp\u003EЛичный бренд &mdash; это то, что о вас говорят люди, когда вы выходите из комнаты\u003C\u002Fp\u003E\r\n\u003Cp\u003EДжефф Безос, основатель Amazon\u003C\u002Fp\u003E\r\n\u003C\u002Fdiv\u003E\r\n\u003Cp\u003EБренд &mdash; это не стиль в одежде, не число подписчиков в соцсетях и даже не известное имя. Вернее, это тоже важно. Но первичны все-таки ассоциации и &laquo;мыслечувства&raquo;, которые возникают у людей при упоминании имени или при взгляде на фотографию. Стив Джобс, Анатолий Вассерман, Илон Маск &mdash; это не просто известные имена. Это люди-образы, люди-бренды с определенной репутацией.\u003C\u002Fp\u003E\r\n\u003Cp\u003EНесмотря на тысячелетия эволюции, человек биологически остается общественным животным с врожденными стайными инстинктами. Мы все хотим ассоциировать себя с кем-то и зачастую думаем: &laquo;Мне нравится этот парень. Мне близки его убеждения, и я хочу быть похожим на него!&raquo;. Мы покупаем у людей, имеющих схожие взгляды, интересы, вкусы. Именно поэтому в условиях высокой рыночной конкуренции так важно иметь персональный бренд. Это те самые &laquo;+100 очков к карме&raquo;, которые позволят привлечь и удержать потребителя.\u003C\u002Fp\u003E\r\n\u003Cp\u003E\u003Cimg src=\"data:image\u002Fpng;base64,iVBORw0KGgoAAAANSUhEUgAABLAAAAKACAYAAACMi4FYAAAACXBIWXMAAAsTAAALEwEAmpwYAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAl54SURBVHgB7P0JtGX5dd6HfWc+585vqnpV1UN1o9FoAA2iAZIgCUpkU7IiRRNblgQBWF4GFCdS5AwEnViWHa+goRUtxZZXSFsJHSqWQTqLIk2Zk4aQVCihSYmkABLEQEyNoecaX7337nzmc7z3PvdVAyAINsCq7q6q7wde3Oncc\u002F7n3OrmrR\u002F2\\u002FbfzuZeH8r77Yvvf03+yh9vpg+ca6fPXQZ+7RMunr3sPKOvy76nsu+pPHxms+mzX\u002Fb4mcs\u002F5TwDQgghhBDyTUGBRQghhJBbkhNB5Xl4ROTRm1VMyf0j8uNGBdR53ATu2mvxL3+otMetmC69feSzLv6HX\u002FbwL3\u002FHeym7eAYtntnIro9jI7myDB+f\u002FrwzBSGEEEII+ZpQYBFCCCHkVc3ksXYShnjU83Fv25isesR1cP4PqpS6GfzF72nwd\u002F96bY+bpvmK9y5cc\u002FD\u002F\u002FFnPhJY+\u002FkZxRGrJ+X1c5Zac3xPy+BMUW4QQQgghHRRYhBBCCHnV8OWyqmnxqPxQeQQ3qZrqm+Gf\u002FZ0Kr7u31XbB3yOwTlimjlVj\u002Ff2fcfHCwQ35qWVVW3L\u002FhNx+lVKLEEIIIXciFFiEEEIIecXQNkC5e1Ru3yu\u002FSvT+PF6laPvgr\u002F0\u002FSnFJDhr5BVW3jbUQKo7jwN3c6yuu3Mub+PBnHXzwl1z8ykdfUnvhS0aO8XE5xMflwRN1hU8c\u002FGPn4yCEEEIIuY2hwCKEEELIy8aXCyvHxWOvRBvgN8vf+2sV\u002FuIfrcUZuaidFo0sXquwVFoprvyscjePu9derNC6cM3Ff\u002FOzngmtG1SV9dU8Y1IL+HlZ4K8yMJ4QQgghtxsUWIQQQgi5aWhLYBxbbtX3y4+Ox\u002FAqrrD6g\u002FjXP1Tg3K5IK\u002Fn5pNVX9SbE\u002FURgeWLkfj+BBavPAhZr4Jc\u002F6uDvi8y6cHDzfoapzJK7J8Sz\u002FYLIrCdACCGEEHKLQ4FFCCGEkBvKRlo9Jr8y3iMe55Fbqcrq9+M7X9\u002FgJ\u002F+zUsyQC41wr1RgiSbSdsGTNkLXdeB7IrHajcSy97Xh0MGX\u002F+Sq0W3\u002F4c+6+PFfdF7q9MJvGg2Hb1qRWazOIoQQQsgtDAUWIYQQQv7QqLRKeniPuBytsnoUtxn\u002FlbYP\u002FpEateOiQpd\u002FZS2EJ1VY8ppnAsuDI7bIM23lagwWWkf+S26ufLbZSC\u002F9vNZJNSK7nr8K\u002FLc\u002FF+C3Pufg4uHL8NNMZJYs7scoswghhBByK0GBRQghhJBvittdWp0w6rXWPjiIterKtRbCtq6R5hmW6zUuv