ddCLQmyurImjz\u002Fx9M0CAACwwRFgAQAAzIm\u002F8Bf+wmjLpk3vLKtK2rYVaTWg6lKYVUpdl5pPWZAVQrT+KwuzNLQKncT0SSmFnUaooVfXdrIybeTE0SP8vQcAADY8\u002FqABAACYE3e97V13T0b19d5vpYXshaVUla4OxtLCK02ubH1QPMDy0wjFgqtmVu3epwCskWa9kYNPP9UIAADABkeABQAAMC\u002FqhTfHogxlWclkYSJ1XaXgKkhIwZVNXtn0la4MVlbq7uFVlK7vpOiinVbYdVroLrK0si5HjhyVw88deFgAAAA2OAIsAACAObF06ugPFOFG0RXChclExuNRCq6890qL2r3BvbBTCPX\u002F6Uphn\u002F4VukKa2Eps+\u002FR5L2vTVg4fPiq\u002F+q9+Ka60a58RAACADY4ACwAAYE68+PRTNzX3vE3qqkzh1UQmk9rCLIlFCqt6e4sxPzgFV\u002FqhNl41KbRqu07aFGAtLa\u002FLU489Jb\u002F4v\u002F5TeeqZpx4bTepPCgAAwAZHgAUAADAnHn30m1v\u002FTPhzUpW1jMa1jBcWbF1Qp6+aFFBJ39mKoE5ZdTp9lT5umkaaaSOra1M5ceSk\u002FNonH5Df\u002FtS\u002Fk7W16bHRZOH\u002FfPDggVUBAADY4AiwAAAA5sSJ46ee\u002FdbXvyG33nKTVHUtk0kKsFKYtba6JjEFWMPKYJfSKwuu2k6mKbh68rEn5fd++z\u002FKp\u002F\u002FTp2R59WT6avmJTYtb\u002F8Hjzzz+iAAAAFwFCLAAAADmxMLi5N\u002Fd\u002F7F\u002F+aHdO\u002FeE63\u002F8z0rXa1F7L03Xy7RJYdV0moKrVpppJ49+\u002FRH51te+LA994fPyxBPfktWmWYkhPLAei390+PChr4ocigIAAHCVCAIAAIC5cO+991bffvTxf7oQu79699veHt7+fT8g+264UaarK7K+NpVjR1+SFw4+K994+GtyauW0dLGPRVE+koKrf3mqqn7xyLPPvpAuQ3AFAACuOgRYAAAAc+Rtb3vbqGyaD26blH9t26bNP3jq5MkyxF6W1htp+zZ2Rd2ttd1TMVS\u002FJlXxr3fs2PG5L33pS40AAABcxQiwAAAA5lP46Z\u002F+u7c++fi3\u002F8iJ44duPr66vh678HwT40OP\\u002FA\u002Fk+FGFZ91fgAAAAAElFTkSuQmCC\"\u003E\u003C\u002Fp\u003E\r\n\u003Ch3\u003EТоп-3 мифов о&nbsp;личном бренде\u003C\u002Fh3\u003E\r\n\u003Cp\u003EС помощью социальных сетей можно за пару недель сделать свой бренд известным\u003C\u002Fp\u003E\r\n\u003Cp\u003EК сожалению, это не так. Социальные сети &mdash; это инструмент. В умелых руках более чем эффективный. Но даже при наличии всех необходимых инструментов автослесарь не переберет двигатель за полчаса, а ювелир не создаст украшение за вечер. То же относится и к личному бренду. Можно выйти голым на площадь и стать известным. Но это про хайп, а не про брендинг. Если вы намерены развивать свой бренд, запаситесь терпением.\u003C\u002Fp\u003E\r\n\u003Cp\u003E\u003Cstrong\u003EЛичный бренд &mdash; это образ, а не человек\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\r\n\u003Cp\u003EВ какой-то мере это действительно так. Все мы хотим казаться чуть лучше, чем есть на самом деле. Но невозможно носить маску в режиме 24\u002F7. Если концепция личного бренда не совпадает с мироощущением человека, его чувствами и убеждениями, то рано или поздно противоречие проявит себя. Представьте модельера, который долгое время позиционировал себя защитником животных, и вдруг выпустил коллекцию из натурального меха. Некрасиво, не правда ли?\u003C\u002Fp\u003E\r\n\u003Cp\u003EЕсли вы&nbsp;не&nbsp;знаете, как начать свой бренд, перебираете варианты, придумываете различные образы, то&nbsp;у&nbsp;нас для вас плохая новость. Рано или поздно маска будет сорвана.\u003C\u002Fp\u003E\r\n\u003Cp\u003EПросто помните, что персональный бренд&nbsp;&mdash; это&nbsp;вы. Со&nbsp;всеми плюсами и&nbsp;минусами, которые у&nbsp;вас есть. Обратите внимание! Это не&nbsp;значит, что не&nbsp;нужно развиваться и&nbsp;работать со&nbsp;своими недостатками. Мы&nbsp;говорим о&nbsp;том, что не&nbsp;нужно притворяться тем, кем вы&nbsp;не&nbsp;являетесь. Правда всегда вылезет наружу.\u003C\u002Fp\u003E\r\n\u003Cp\u003E\u003Cstrong\u003EПерсональный бренд отнимает все свободное время\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\r\n\u003Cp\u003EСоздание и продвижение персонального бренда действительно требует времени. Но совсем не так много, как принято считать. Если вы ничего не выдумываете и позиционируете собственную личность как бренд, то вам не придется тратить силы на поддержку идеального образа. Ваша задача состоит в том, чтобы показать окружающим, чем и как вы занимаетесь.\u003C\u002Fp\u003E\r\n\u003Cp\u003EКаждая рабочая встреча, каждый ответ подписчику, каждый комментарий или пост&nbsp;&mdash; это вклад в&nbsp;развитие. Вы&nbsp;все равно встретились&nbsp;бы с&nbsp;клиентом, ответили подписчику и&nbsp;написали пост на&nbsp;своей странице. Так почему&nbsp;бы не&nbsp;извлечь из&nbsp;повседневных действий дополнительную выгоду?\u003C\u002Fp\u003E\r\n\u003Cp\u003EЕсли вы&nbsp;хорошо представляете себе позиционирование и&nbsp;у&nbsp;вас есть стратегия продвижения, то&nbsp;непосредственная работа (как мы&nbsp;обычно ее&nbsp;себе представляем) с&nbsp;личным брендом будет занимать около одного часа в&nbsp;день. Пожалуй, это не&nbsp;настолько высокая плата за&nbsp;возможность добиться успеха в&nbsp;том, что вы&nbsp;делаете.\u003C\u002Fp\u003E\r\n\u003Cp\u003E\u003Cimg src=\"data:image\u002Fpng;base64,iVBORw0KGgoAAAANSUhEUgAABLAAAAKACAYAAACMi4FYAAAACXBIWXMAAAsTAAALEwEAmpwYAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAS6SSURBVHgB7P0NcB3neecLPoeUJ7u1JgnNvVuzpuQhaMcjinZMsCKNVOWKAeqONM7aK4CW7VqZygKQqkby3CoD2oqYqV3RODS9tWs5VQA8WX1kRgR4rY+JZRmkIkeKNdEBleRaijQ5AKhQXyQPFIl03eTGAEnfuZVrUX3f\u002F9v9HDSa56O7T3efPsD\\u002FN+wf3dJedd879l813LcsVHzHu\u002FWi5s370ohBBCCCGEEEJIHShgEbKGMUJVl1ySPtm4sdfc7t3iOD1SQ5RavnDR2uLZc\u002Fb14vtnq79bfP+chKFr0ybp2rLJ\u002FXmz+XnzZu\u002F9j9qf3fc2NdqEEbOcRSt0FQorP0Pwci4temLXohG7loUQQgghhBBCyLqCAhYhawwrWn24YVQ2bOg1glWfvg8hau6NN2XxPfz7lhGsLth\u002Fz5834tXFi5IVELq2GKGr++qr7Ovuq7aan7dWBTC8D9HL\u002Fltb8PIJXTLnilwfzLseXTJHgYsQQgghhBBC1h4UsAhZI3jCVVEKhUHzsmv25VfF2iuvyfzJtzIVqZJk29VbV4laVvD6+Fbr1aXiVwBX4CpsWLT\u002FXpJ514OL4hYhhBBCCCGEdCoUsAhZAziVE33iODPLFy52TRz+gUxOPd6xglUcenZeI1t8ghZeQ+DqufaaoBcXBKw5N0RRZuWDD+YRmljY\u002Fpk5IYQQQgghhBCSWyhgEdLhOKfKA7Jh48zRn74ow\u002FcdWFfCVRgQmrjr0zusB1fPzh1W3ILQhZ99eMKWDUlcdIUtemwRQgghhBBCSF6ggEVIB2OrCToby8WJB7sOfv9hIdGAmLXNE7NqC1vOnBuKqN5aFLUIIYQQQgghpB1QwCKkg3EqC1OL750d2v753xaSDOqxhfBDK2h5P6+EIlLUIoQQQgghhJCsoYBFSIfieV9Vdn\u002Fxq7aaIEkX9dbqu+H6OqJWYVYuXTouGz+yyJxahBBCCCGEEJIsFLAI6VCcUwsDi+fOztD7qn1A1IKQ1QtRCz+vhB8uGkELItas6WaPU9AihBBCCCGEkNaggEVIh+JUTowd\u002FdM\u002FK+69Z1RIPtDww74brpO+G6\u002F3e2lp9cOjCDssfGr3rBBCCCGEEEIICQ0FLEI6FOfUwtDR\u002F\u002FziFAWs\u002FDJ0W7+MDO+T6aefMYLWdTb88DJBix5ahBBCCCGEENIUCliEdChO5UTf8vkLpe2\u002F9QVZvnix+v7YyDekaKweyxcuWlt5faH6evniL+1rsPj+uernzxtbfP\u002Fsqs\u002Fo70l9Ki89L3tuv1MWz